import React from 'react';

const RoomComp = ({ room }) => {
    return (
        <div className="room">
            <h3>Room Number: {room.roomNumber}</h3>
            <p>Room Type: {room.roomType}</p>
            <p>Status: {room.clean ? "Clean" : "Dirty"}</p>
        </div>
    );
}

export default RoomComp;
